import React, { useEffect } from 'react';
import { LOAD_USER_REQUEST } from '../reducers/user';

export default function handler(req, res) {
    useEffect(() => {
        dispatch({
            type: LOAD_USER_REQUEST
        });
    }, []);
    res.status(200).redirect('http://localhost:3051/user/google');
}
